#
# It's messy, but it works! Maybe there's a more efficient data structure that could be used?
#
from typing import List
from collections import Counter
class Solution:
    def maxBoxesInWarehouse(self, boxes: List[int], warehouse: List[int]) -> int:
        N = len(warehouse)
        lft_pfx = [0 for _ in range(N)]
        rgt_pfx = [0 for _ in range(N)]
        for i in range(N):
            if i == 0:
                lft_pfx[i] = warehouse[i]
            else:
                lft_pfx[i] = min(lft_pfx[i-1], warehouse[i])
        for i in range(N-1, -1, -1):
            if i == N - 1:
                rgt_pfx[i] = warehouse[i]
            else:
                rgt_pfx[i] = min(rgt_pfx[i+1], warehouse[i])
        wh_arr = [max(a, b) for a, b in zip(lft_pfx, rgt_pfx)]
        wh_cnt = Counter(wh_arr)
        wh_keys = sorted(wh_cnt, reverse=True)
        bx_cnt = Counter(boxes)
        bx_keys = sorted(bx_cnt, reverse=True)
        res = 0
        pos = 0
        for k in bx_keys:
            #print(k, pos, wh_keys[pos], res)
            while True:
                if pos >= len(wh_keys):
                    break
                k1 = wh_keys[pos]
                if k <= k1 and bx_cnt[k] > 0 and wh_cnt[k1] > 0:
                    if bx_cnt[k] < wh_cnt[k1]:
                        res += bx_cnt[k]
                        wh_cnt[k1] -= bx_cnt[k]
                        bx_cnt[k] = 0
                    elif wh_cnt[k1] < bx_cnt[k]:
                        res += wh_cnt[k1]
                        bx_cnt[k] -= wh_cnt[k1]
                        wh_cnt[k1] = 0
                        pos += 1
                    else:
                        res += bx_cnt[k]
                        bx_cnt[k] = 0
                        wh_cnt[k1] = 0
                        pos += 1
                else:
                    break
        return res

